import React, { Component } from 'react';
import IntlMessages from '../../../../../util/IntlMessages';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import Slide from '@material-ui/core/Slide';
import Button from '@material-ui/core/Button';
export default class ConfirmationNotifMail extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <Dialog
        open={this.props.modal}
        TransitionComponent={Slide}
        onClose={this.props.handleCancelNotif}
      >
        <DialogContent>
          <DialogContentText>
            {<IntlMessages id="sweetAlerts.areYouSure" />}
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={this.props.handleCancelNotif} color="secondary">
            {<IntlMessages id="button.no" />}
          </Button>
          <Button
           onClick={this.props.handleSubmitNotif}
            color="primary"
          >
            {<IntlMessages id="button.yes" />}
          </Button>
        </DialogActions>
      </Dialog>
    );
  }
}
